script: |
  super -f text -I q12092.spq | sort > q12092.out

inputs:
  - name: q12092.spq
    data: |
      SELECT - COUNT ( * ) FROM tab1 (FORMAT parquet) WHERE - col1 NOT BETWEEN - + 13 * - CAST ( col0 AS INTEGER ) AND + 5 * + - col2 + + 42 * - + col2;
  - name: tab1

outputs:
  - name: q12092.out
    data: |
      -3
